	render() {
		return (
			<div className="App">
				<Router>
					<div>
						<Route exact path="/" render = { () => <UserForm /> } />						
						{/* <Route exact path="/" render = { () => <Main /> } />					 */}
					</div>
				</Router>
			</div>
		);
	}
}

export default App;



